In this first phase, we encrypt some plaintext using the iris_encrypt RPC endpoint exposed by each Iris node. The endpoint uses the umbral_pre TPRE library to generate new keys and encrypt your data. Subsequently, it sends an unsigned tx to include the generated 'capsule' and public key on-chain (see iris protocol for more details). To allow a valid address to be authenticated and used for signing, the endpoint requires the caller to pass their account id along with a signature and signed message, which is used to recover the caller's account. To choose a proxy node query the x25519_public_keys runtime storage map in the 'Authorities' pallet and choose any validator with a key. Messages can be signed with the polkadotJS library: import { stringToU8a, u8aToHex } from '@polkadot/util';
// connect to node, create keyring and get 'account'
let message = 'random message';
let signature = account.sign(stringToU8a(message));
// convert the signature to hex before calling extrinsic
let sig_as_hex = u8aToHex(signature); You can then call the iris_encrypt RPC with await api.rpc.iris.encrypt(plaintext, signature, signer, message, proxy) .then(res => success_callback(res)) .catch(err => error_callback(err)); For an example, see how we handle uploads in the iris-ui

