A rule exeuctor can theoretically be any contract that can make calls to the Iris runtime using the 'submit results' chain extension. The owner of a data asset class must register a rule executor contract address with their data through the 'Authorization' pallet after the exeuctor is deployed and their data asset class exists. This delegates rights to the rule executor to grant access to other nodes that meet the rules specified. That is, every rule exeuctor must call: #[ink::chain_extension]
pub trait Iris { type ErrorCode = CustomError; #[ink(extension = 4, returns_result = false)] fn submit_results( caller: ink_env::AccountId, consumer: ink_env::AccountId, asset_id: u32, result: bool, public_key: [u8;32], ) -> [u8; 32];
} and invoke the chain extension function: self.env() .extension() .submit_results( contract_acct, caller.clone(), asset_id.clone(), true, public_key.clone(), ); And also be registered in the Authorization pallet.
